import React from 'react';
import './Main.css';
import SearchBar from './SearchBar';
import logo from '../images/logo.svg';
import Typist from 'react-typist';

function Main() {
  return (
    <div className='main-container'>

      <h1 className="main-logo">
        <Typist>
          <span className='main-ele'> The First Legal Research Website Based On Time </span>
          <Typist.Backspace count={49} delay={200} />
          <span className='main-ele'> This is Quick </span>
          <Typist.Backspace count={16} delay={200} />
          <span className='main-ele'> This is Accurate </span>
          <Typist.Backspace count={16} delay={200} />
          <span className='main-ele-logo'> LegalEngine<span className='main-ele-logo-dot'>. </span></span>
        </Typist></h1>
      <SearchBar />
    </div>
  );
}

export default Main;
